  false,\n\t\"url\": null,\n\t\"notes\": \"This data collection includes data from
  multiple SVP drifters deployed in the region of American Samoa to assess ocean currents
  and sea surface temperature. Drifter data files contain drifter ids, year, month,
  day, hour, minute, second, GPS latitude and longitude. Drifter data was collected
  hourly. All dates and times are UTC. Contact Coral Reef Ecosystem Division (CRED),
  NOAA Pacific Island Fisheries Science Center for more information.nnThese data were
  collected for coral reef ecosystem research. They are collected concurrently with
  ecological/biological reef assessments and monitoring data.\",\n\t\"license_title\":
